import React from "react";
import "./ExpenseItem.css";

const ExpenseItem = () => {
  return (
    <div>
      <div className="expenseItem m-2">
        <div className="ms-2 d-flex">
          <p className="ms-2">Date</p>
          <h2>Title</h2>
          <p>Price</p>
        </div>
      </div>
    </div>
  );
};

export default ExpenseItem;
